import useGet from "./server_fetch/useGet";

const DisplayBlog = () => {
  const { datas, error, isPending } = useGet(
    "http://localhost:8000/get_all_blogs"
  );
  console.log(isPending);
  console.log(error);
  return (
    <div>
      <div>{datas}</div>
    </div>
  );
};

export default DisplayBlog;
